INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (1, 160, 105, 0.029, 1, 1, 1.5, 0, 0, 122601, "仲間と夏を楽しむ、夏海の魔法士。自分を変えたいという固い決意で、障害物を無効化して走り続ける。", 1, 101, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (2, 120, 111, 0.014, 3, 2, 2.5, 0, 1, 122401, "太陽よりも輝く、夏海の元気娘。　持ち前の身体能力で、どんなコースも柔軟に対応し、駆け抜ける。", 0, 102, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (3, 350, 105, 0.017, 2, 3, 2.5, 1, 0, 122501, "波打ち際に煌めく、夏海の剣士。　日々の鍛錬で鍛えた脚で、長い距離も速度を落とさず走り切る。", 0, 103, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (4, 130, 105, 0.016, 3, 4, 1.5, 0, 1, 107501, "海の幸に目がない、渚のお姫様。　『王家の装備』の力を解放し、障害物をものともせず前へと進む。", 0, 104, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (5, 160, 105, 0.014, 1, 5, 2.5, 0, 0, 107601, "海でも主さまをお世話する、白浜の巫女。精霊の力で自身を加速させ、誰よりも速くゴールを目指す。", 1, 105, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (6, 255, 103, 0.029, 2, 6, 3.5, 1, 0, 107801, "水着姿を恥じらう、ツンデレ猫娘。お得意の魔法で、対戦相手の走りを妨害し、レースを有利に進める。", 0, 106, 120);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (7, 160, 103, 0.013, 1, 7, 3.5, 0, 0, 110601, "優雅に浜を駆ける、真夏のマホ姫。しゃなりしゃなりと、雅な身のこなしで障害物を跳び越えていく。", 1, 107, 120);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (8, 350, 103, 0.014, 2, 8, 2.5, 1, 0, 110401, "浜の平和を守る、真夏の狼娘。　　獣人の強靭なスタミナで、レース　後半にスパートをかける。", 0, 108, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (9, 130, 100, 0.012, 3, 9, 1.5, 0, 1, 110501, "浜に力強く舞う、真夏の南国娘。　レースの喧噪の中でも精神を乱さず後半に大きな捲りを見せる。", 0, 109, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (10, 200, 103, 0.014, 1, 10, 2.5, 0, 0, 115701, "浜の事件を嗅ぎ付けた、真夏の　　名探偵。高い推理力と魔法で、的確に対戦相手の走りを乱す。", 1, 110, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (11, 350, 103, 0.071, 2, 11, 2.5, 1, 0, 113601, "再び鎧を脱いだ、灼熱の騎士団長。実戦で培った判断力で、瞬時にバリアを展開し、障害物を無力化する。", 0, 111, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (12, 130, 103, 0.014, 3, 12, 1.5, 0, 1, 107901, "水が苦手な、海辺の気まぐれ猫娘。浜に現れた美少女義賊は、対戦相手のスピードを奪いとる。", 0, 112, 120);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (13, 200, 105, 0.022, 2, 13, 1.5, 0, 0, 108001, "バカンスも効率第一な、海の傭兵。レースでも最高効率を求め、どんな状況でも隙のない走りを見せる。", 1, 113, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (14, 160, 108, 0.031, 1, 14, 2.5, 0, 0, 110301, "真夏の太陽が良く似合う、海辺の　サレンママ。多才で器用、どんな　障害物もエレガントに越えていく。", 1, 114, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (15, 130, 105, 0.036, 1, 15, 0.5, 0, 1, 107701, "海に嵐を呼ぶ夏のドジっ娘メイド。日頃から災難に慣れており、多少　のトラブルには動じたりしない。", 0, 115, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (16, 350, 95, 0.048, 2, 16, 3.5, 1, 0, 113101, "粋な夏を愉しむ、若夏の姉御。　　流麗な身体捌きで、始・継・終と、UBを重ねるごとに、加速する。", 0, 116, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (17, 130, 105, 0.043, 3, 17, 1.5, 0, 1, 113301, "夏のトキメキに触れた、オタク魔法少女。多彩な魔法を操り、少しずつ他の走者の速度を落とし続ける。", 0, 117, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (18, 130, 95, 0.018, 2, 18, 1.5, 0, 1, 113201, "海獄に降臨せし、真夏の冥姫。　　レース後半に魔力を全解放し、　　蒼き疾風と成りて浜を駆け抜ける。", 0, 118, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (19, 160, 108, 0.021, 2, 19, 2.5, 0, 0, 117001, "夏の夕を火花で彩る、渚の壊し屋。『壊し屋』の異名と過激な愛情は、対戦相手にプレッシャーを与える。", 1, 119, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (20, 255, 105, 0.036, 1, 20, 2.5, 1, 0, 113501, "青春に生きる者を導く、夏の先生。夢へと邁進する聖母の加護が、その身をあらゆる困難から守る。", 0, 120, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (21, 350, 105, 0.02, 3, 21, 2.5, 1, 0, 113401, "笑顔の応援が眩しい、夏の超能力　ガール。超能力を駆使して、どんな障害物もひとっ飛びで乗り越える。", 0, 121, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (22, 130, 105, 0.018, 1, 22, 2.5, 0, 1, 110101, "海辺で大人の魅力を放つ、夏の　　セクシー先生。その魅力に囚われた対戦相手は、走りを乱してしまう。", 0, 122, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (23, 160, 111, 0.03, 3, 23, 3.5, 0, 0, 110001, "水着も絶対外さない、夏のカリスマモデル。走りのバイブスは超テンアゲで、スピードはおにやば。", 1, 123, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (24, 130, 103, 0.027, 1, 24, 1.5, 0, 1, 117201, "南の島も盛り上げる、真夏のアイドル。悪天候でも笑顔を絶やさず後半もリズムを上げて走り切る。", 0, 124, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (25, 160, 108, 0.02, 2, 25, 3.5, 0, 0, 117301, "海原に美声を響かす、渚の歌姫。　守護の賛歌と精霊の加護により、　障害物から身を守る。", 1, 125, 105);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (26, 350, 105, 0.04, 3, 26, 2.5, 1, 0, 117401, "夏でも天邪鬼な、夕凪のテーラー。張り巡らされた魔法の糸で、他の走者の自由を奪う。", 0, 126, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (27, 350, 105, 0.009, 1, 27, 3.5, 1, 0, 117101, "向日葵が良く似合う、海辺の　　　お姉ちゃん。秘密結社の一員で、　抜群の身体能力が一番の武器。", 0, 127, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (28, 255, 105, 0.022, 1, 28, 3.5, 1, 0, 122901, "渚でおっとり、夏色うさぎっこ。　うさぎさんパワー全開で、ぴょん　ぴょんとコースを跳ね回る。", 0, 128, 120);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (29, 130, 105, 0.028, 3, 29, 2.5, 0, 1, 122801, "無邪気さ弾ける、夏色いたずら娘。砂浜でも、いたずらの準備は万端！レースに大波乱が巻き起こる！？", 0, 129, 110);
INSERT INTO `v1_82dc32e9dff46e0fa0373ba695a91a936fe0d9b4de2a0d2640f6369bd3c25c86` VALUES (30, 130, 108, 0.023, 2, 30, 3.5, 0, 0, 122701, "海でも真面目な、夏色優等生。　　高めた魔力を解き放ち、一瞬の内に他の走者を置き去りにする。", 1, 130, 105);
